import './App.css';
import 'bulma/css/bulma.css'

import QuizCreationForm from './components/create/quizCreationForm';

function App() {
  return (
    <div className="has-background-light app content">
      <div className="container">
        <QuizCreationForm />
      </div>
    </div>
  );
}

export default App;
